import { compose } from "redux";
import { connect } from "react-redux";
import FollowersList from "./FollowersList";
import { setUserFollowersThunk } from "../../Store/thunks";

let mapStateToProps = (state) => {
  console.log(state);
  return {
    login: state.followers.userinfo.login,
    company: state.followers.userinfo.company,
    email: state.followers.userinfo.email,
    avatar_url: state.followers.userinfo.avatar_url,
    blog: state.followers.userinfo.blog,
    repos_url: state.followers.userinfo.repos_url,
  };
};
let mapDispatchToProps = (dispatch) => {
  return {
    setUserFollowers: () => {
      setUserFollowersThunk(dispatch);
    },
  };
};

export default compose(connect(mapStateToProps, mapDispatchToProps))(
  FollowersList
);
